import React from 'react';
import s from './Profile.module.css';
import Interests from "./Interests";
import * as axios from "axios";



const Profile = (props) => {

    const showData=()=>{
        axios.get(`https://chat-server-project.herokuapp.com/api/messages?user_getting=4`,{withCredentials: true}).then(response=>{
            console.log(response)
        })
    }
    showData()
    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: {props.profilePage.name}</div>
                <div>Рейтинг: {props.profilePage.rating}</div>
                <Interests buttonIsClicked={props.buttonIsClicked}interests={props.profilePage.interests} changeInterests={props.changeInterests}/>


            </div>
        </div>
    )
}


export default Profile;
